pub trait RequestDriver { type Request: Copy + Send; type Response: Copy + Send; type SubmitError; async fn submit(&self, reqs: &[SubmitRequest<Self::Request>]) -> Result<(), Self::SubmitError>; fn flush(&self); const NUM_IDS: usize;
} Note: async functions in traits is unsupported by Rust at time of writing, so we use the async_trait crate here to make it possible to write this. The associated types Request, Response, and SubmitError refer to the types of objects that this requester will submit to the device, responses the device sends back, and errors that the request driver can generate when submitting requests. The SubmitRequest type is a wrapper around the driver's Request associated type that includes an ID of type u64. The number of inflight requests will not exceed NUM_IDS, and all IDs will be less than that value (this allows the driver to specify backpressure and queue limits). Similarly, the ResponseInfo type is a wrapper around the Response type that also includes the ID of the request that is associated with this response, and a boolean indicating if this response is considered an error or not.

